import React from 'react';
import styled from 'styled-components';
import {KineBox} from "../../styles/style";
import {Col, Row} from "react-bootstrap";

const Styles = styled.div`
    margin-top: 20px;
`;


const Patients = [
    {
        name: "Antoine DUPLESSIS"
    },
    {
        name: "Anna MONTEAU"
    },
    {
        name: "Erwan LORIEL"
    },
];

function RenderRecurrentPatients() {
    return (
        Patients.map((item, i) => {
            return (
            <Row>
                <Col>
                    {item.name}
                </Col>
                <Col className="d-flex justify-content-end">
                    <a href="###">Accéder à la fiche patient</a>
                </Col>
            </Row>
            )
        })
    );
}

function RenderExercices() {
    return (
        <h1>aze</h1>
    );
}


class Home extends React.Component {
    constructor(props) {
        super(props);
        document.title = "Home";
    }

    render() {
        return (
            <Styles>
                <Row>
                   <Col style={{flex: '0 0 500px'}}>
                       <KineBox>
                           <h1>Patients récurrents</h1>
                           <RenderRecurrentPatients/>
                       </KineBox>
                       <KineBox>
                           <h1>Exercices à prescrire</h1>
                           <RenderExercices/>
                       </KineBox>
                   </Col>
                </Row>
            </Styles>
        );
    }
}

export default Home;
